(3, 'TODAYS ISL MATCH|| MOHUN BAGAN VS MUMBAI CITY FC', 12, 2, '<p style=\"margin-top: 10px; margin-bottom: 10px; color: rgb(18, 18, 18); font-size: 16px; text-align: justify;\"><font face=\"Arial Black\"><a target=\"_blank\" href=\"https://sportstar.thehindu.com/newstag/Mumbai_City_FC-1/?utm=bodytag\" style=\"color: rgb(0, 86, 179); font-weight: 700;\"><span style=\"font-weight: 500;\">Mumbai City FC&nbsp;</span></a>will be aiming to keep its unbeaten record in the&nbsp;<a target=\"_blank\" href=\"https://sportstar.thehindu.com/newstag/Indian_Super_League/?utm=bodytag\" style=\"color: rgb(0, 86, 179); font-weight: 700;\"><span style=\"font-weight: 500;\">Indian Super League&nbsp;</span></a>2022-23 (<a target=\"_blank\" href=\"https://sportstar.thehindu.com/newstag/ISL/?utm=bodytag\" style=\"color: rgb(0, 86, 179); font-weight: 700;\"><span style=\"font-weight: 500;\">ISL)&nbsp;</span></a>intact when it faces&nbsp;<a target=\"_blank\" href=\"https://sportstar.thehindu.com/newstag/atk-mohun-bagan/?utm=bodytag\" style=\"color: rgb(0, 86, 179); font-weight: 700;\"><span style=\"font-weight: 500;\">ATK Mohun Bagan&nbsp;</span></a>here at the Mumbai Football Arena on Sunday.</font></p><p style=\"margin-top: 10px; margin-bottom: 10px; color: rgb(18, 18, 18); font-size: 16px; text-align: justify;\"><font face=\"Arial Black\">Both sides are coming into this game after convincing 2-0 wins in their last games. The Islanders defeated Kerala Blasters while the Mariners were triumphant in the Kolkata Derby against arch-rivals East Bengal.</font></p>', '2022-11-06 06:54:44', NULL, 1, 'TODAYS-ISL-MATCH||-MOHUN-BAGAN-VS-MUMBAI-CITY-FC', '79d4982c1e213ceafb38a8d415798c7d.jpg'),
(4, 'ISL 2022-23: Sahal stars as Kerala Blasters beats NorthEast United 3-0', 12, 2, '<p style=\"margin-top: 10px; margin-bottom: 10px; color: rgb(18, 18, 18); font-family: Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px; text-align: justify;\">Mumbai City FC will take the field on Sunday with the psychological advantage of being unbeaten against ATK Mohun Bagan in the league.</p><p style=\"margin-top: 10px; margin-bottom: 10px; color: rgb(18, 18, 18); font-family: Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px; text-align: justify;\">Head coach Des Buckingham is expected to make no changes to the eleven that started against the Blasters. Alberto Noguera is expected to start from the bench as Greg Stewart takes his place in the midfield, allowing Jorge Diaz to operate upfront.</p><p style=\"margin-top: 10px; margin-bottom: 10px; color: rgb(18, 18, 18); font-family: Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif; font-size: 16px; text-align: justify;\">Diaz is expected to be flanked by Lallianzuala Chhangte and Bipin Singh. The duo has started every game for the host so far this season. Defender Mehtab Singh has pocketed three Hero of the Match awards in four games so far and will start alongside Rostyn Griffiths in defence.</p>', '2022-11-06 07:01:30', '2022-11-06 07:28:35', 1, 'ISL-2022-23:-Sahal-stars-as-Kerala-Blasters-beats-NorthEast-United-3-0', 'bf34953f60d73d97e6e7d26a7eacf8e5.jpg');

